actionConfiguration.body:
() => {
		const mobileNo = vayFgnAuthMobile.text.replace(/\s/g,'')
		if(vayFgnAuthSignAddCountrySelect.selectedOptionValue=='IN') {
				if(mobileNo.length === 10 || mobileNo.length === 11)
					return true;
				else
					return false;
		}
		else if(mobileNo.length >= 5 && mobileNo.length <= 15) {
				return true;
    }
    else {
        return false
    }
	}

